import {Col, Container, Row} from "react-bootstrap";
import {CircleFill} from "react-bootstrap-icons";
import "./Settings.css";
const Settings = () => {
    return (
            <div className="container">
                <div className="row">
                    <div className="col col-sm-4">
                        <div className="p-2 bg-light border">
                            <CircleFill size={70}/>
                            <h2>"NAME"</h2>
                        </div>
                    </div>
                    <div className="col">
                        <div className="p-2 bg-light border">
                            <h3>Settings</h3>
                        </div>
                    </div>
                </div>
            </div>
    );
}

export default Settings;
